window.bookSummaryJSON = "<p><b>Victory snatched from the jaws of defeat.</b></p> <p>Commodore Jack Romanoff and his ragtag crew have repaired their ancient battleship, scattered their adversaries at New Copenhagen, and discovered what was really behind the invasion. Now they must make the enemy bleed and begin liberating the cluster.</p> <p><b>Betrayal from the shadows.</b></p> <p>When someone unexpected conspires against him, Jack must keep his ship and crew united and safe. If he fails, someone powerful that should have had his back will stick a knife into it, and the aliens will enslave or exterminate them all.</p> <p><b>Honor or victory? Can he have both?</b></p>"; 
